import React from 'react'
import { useState } from 'react';
import Slidebar from './Slideshow/Slidebar'
import Footer from './Footer/Footer'

function VedicSchool() {
    const [firstName, setFirstName] = useState('');
    const [lastName, setLastName] = useState('');
    const [phoneNumber, setPhoneNumber] = useState('');
    const [homeNumber, setHomeNumber] = useState('');
    const [email, setEmail] = useState('');
    const [age, setAge] = useState('');
    const [selectedCourses, setSelectedCourses] = useState([]);
    const [instructorName, setInstructorName] = useState('');
    const [comments, setComments] = useState('');
    const [formValid, setFormValid] = useState(true);
    const [formValidPhone, setFormValidPhone] = useState(true); 
    const [formValidEmail, setFormValidEmail] = useState(true);
    const [showModal, setShowModal] = useState(false);
    const Vedic = require('../Img/Vedic.webp')

    const [courseCatalog, setCourseCatalog] = useState([
        "Introduction to Sanskrit",
        "Advanced Sanskrit Grammar",
        "Vedic Hymns and Chants",
        "Rigveda Recitation Workshop"
    ]);

    // Function to handle phone number change
    const handlePhoneNumberChange = (e) => {
        const { value } = e.target;
        setPhoneNumber(value);
        // Example phone number validation (adjust as needed)
        if (value.length === 10) {
            setFormValidPhone(true);
        } else {
            setFormValidPhone(false);
        }
    };

    // Function to handle home number change
    const handleHomeNumberChange = (e) => {
        const { value } = e.target;
        setHomeNumber(value);
        // Example home number validation (adjust as needed)
        if (value.length === 10) {
            setFormValid(true);
        } else {
            setFormValid(false);
        }
    };

    // Function to handle email change
    const handleEmailChange = (e) => {
        const { value } = e.target;
        setEmail(value);
        // Example email validation (adjust as needed)
        const emailRegex = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;
        setFormValidEmail(emailRegex.test(value));
    };

    // Function to handle course selection
    const handleCourseSelection = (course) => {
        // Toggle course selection
        if (selectedCourses.includes(course)) {
            setSelectedCourses(selectedCourses.filter(selectedCourse => selectedCourse !== course));
        } else {
            setSelectedCourses([...selectedCourses, course]);
        }
    };

    const handleSubmit = async() => {
        // Validation logic goes here
        if (!firstName || !lastName || !phoneNumber || !email ||!age|| !selectedCourses||!instructorName) {
            setFormValid(false);
            return;
        }
        document.getElementById("submitBtn").disabled = true;
        const formData = {
            firstName,
            lastName,
            phoneNumber,
            homeNumber,
            email,
            age,
            selectedCourses,
            instructorName,
            comments
        };
        console.log(formData)
        try {
            // Make a POST request to the backend API endpoint
            const response = await fetch('https://jssnode.onrender.com/api/vedic', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify(formData),
            });

            // Check if the request is successful
            if (response.ok) {
                // Parse the response data
                const data = await response.json();
                setShowModal(true);
                document.getElementById("submitBtn").disabled = false;
                // Log a success message with the saved data
                console.log('Catering Req data saved successfully:', data);
                // Set form validity state to true
                setFormValid(true);
            } else {
                // If the request fails, parse and log the error message
                document.getElementById("submitBtn").disabled = false;
                const errorData = await response.json();
                console.error('Error saving Catering req data:', errorData.error);
            }
        } catch (error) {
            // If an error occurs during the fetch operation, log the error
            console.error('An error occurred while saving Catering req data:', error);
        }
    };

    const handleDownloadPDF = () => {
        try {
            // Convert the base64 string to a Uint8Array
            const pdfBase64 = '';
            const byteCharacters = atob(pdfBase64);
            const byteNumbers = new Array(byteCharacters.length);
            for (let i = 0; i < byteCharacters.length; i++) {
              byteNumbers[i] = byteCharacters.charCodeAt(i);
            }
            const byteArray = new Uint8Array(byteNumbers);
      
            // Create a Blob from the Uint8Array
            const blob = new Blob([byteArray], { type: 'application/pdf' });
      
            // Create a temporary URL for the Blob
            const blobUrl = window.URL.createObjectURL(blob);
      
            // Create a temporary anchor element
            const downloadLink = document.createElement('a');
      
            // Set the href attribute to the Blob URL
            downloadLink.href = blobUrl;
      
            // Set the download attribute to force download with the file name
            downloadLink.download = 'Course Catolog.pdf';
      
            // Append the anchor element to the body
            document.body.appendChild(downloadLink);
      
            // Click the anchor element to trigger the download
            downloadLink.click();
      
            // Remove the anchor element from the body
            document.body.removeChild(downloadLink);
      
            // Release the temporary URL created for the Blob
            window.URL.revokeObjectURL(blobUrl);
          } catch (error) {
            console.error('Error downloading PDF:', error);
          }
    };
    const closeModal = () => {
        setShowModal(false);
        setFirstName('');
        setLastName('');
        setPhoneNumber('');
        setHomeNumber('');
        setEmail('');
        setAge('');
        setSelectedCourses([]);
        setComments('');
        setInstructorName('');
    }

    return (
        <>
            <div className='container-fluid bg' style={{ color: 'white' }}>
                <div className='container'>
                    <div className='d-flex justify-content-center align-item-center mt-5'>
                        <div className='py-5 pb-5 text-center mt-5'>
                            <div className='mt-5'>
                                <h3 className='h styleHeading'>Vedic School</h3>
                            </div>
                            <div className='mt-3'>
                                <p className='paraContent'>“I am in the Light. I am the Light. The Light is in Me.<br></br>
                                    The Light is Myself.”</p>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
            <div className='container-fluid px-0'>
                <Slidebar img1={Vedic} />
            </div>
            <div className='container-fluid px-0 ' style={{ color: 'black' }}>
                <div className='container'>
                    <div className='justify-content-center align-item-center'>
                        <div className='row mx-0'>
                            <div className='col-lg-12'>
                                <div className='text-center'>
                                    <div className='justify-content-center align-item-center'>
                                        <div className='mt-5'>
                                            <div>
                                                <h2 className='styleHeadingForm' style={{ margin: '0' }}>Embark on an enriching journey with our Vedic School</h2><hr class="separator separator--line" style={{ margin: '0' }} />
                                            </div>
                                            <div className="mx-auto" style={{ paddingTop: 40 }}>
                                                <div className=''>
                                                    <p className='priPass'>Dive into Indian culture with captivating lessons on shlokas, deities, and traditions. Classes are held every Saturday and Sunday from 9 am to 12 pm, tailored for children aged 5 to 16. Join us to foster a sense of belonging and compassion while celebrating our vibrant heritage. Each course is designed with specific age groups in mind to ensure a personalized learning experience.</p>
                                                </div>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            </div>
                            <div className='col-lg-12 mt-5'>
                                <div className='pb-5 text-center'>
                                    {/* Personal Details Section */}
                                    <div className='justify-content-center align-item-center'>
                                        <div>
                                            <h2 className='styleHeadingForm' style={{ margin: '0' }}>JSS Yoga Form</h2>
                                            <hr className="separator separator--line" style={{ margin: '0' }} />
                                        </div>
                                        <div className='container' style={{ paddingTop: 40 }}>
                                            <div className='row'>
                                                <div className="col-lg-6 mx-auto">
                                                    <div className="text-left">
                                                        <p className='PersonalPass' style={{ margin: '0' }}>Personal Details</p>
                                                        <hr className='Personal Personal--line' style={{ margin: '0' }} />

                                                        {/* Student First Name */}
                                                        <div className="text-center mt-3">
                                                            <div className='text-left'>
                                                                <label htmlFor="firstName" className="form-label">Student First Name<span className='text-danger'>*</span></label>
                                                            </div>
                                                            <input type='text' id='firstName' value={firstName} placeholder='Enter your First Name' className={`form-control ${(!firstName && !formValid) && 'border-bottom border-danger'}`} onChange={(e) => setFirstName(e.target.value)} style={{ border: 'none', borderBottom: '1px solid gray', borderRadius: '0' }}></input>
                                                        </div>

                                                        {/* Student Last Name */}
                                                        <div className="text-center">
                                                            <div className='text-left mt-3'>
                                                                <label htmlFor="lastName" className="form-label">Student Last Name<span className='text-danger'>*</span></label>
                                                            </div>
                                                            <input type='text' id='lastName' value={lastName} placeholder='Enter your Last Name' className={`form-control ${(!lastName && !formValid) && 'border-bottom border-danger'}`} onChange={(e) => setLastName(e.target.value)} style={{ border: 'none', borderBottom: '1px solid gray', borderRadius: '0' }}></input>
                                                        </div>

                                                        {/* Phone Number */}
                                                        <div className="text-center">
                                                            <div className='text-left mt-3'>
                                                                <label htmlFor="phoneNumber" className="form-label">Phone Number<span className='text-danger'>*</span></label>
                                                            </div>
                                                            <input
                                                                type='text'
                                                                id='phoneNumber'
                                                                value={phoneNumber}
                                                                placeholder='Enter your Phone number'
                                                                className={`form-control ${(!phoneNumber && !formValid) && 'border-bottom border-danger'}`}
                                                                onChange={handlePhoneNumberChange}
                                                                style={{ border: 'none', borderBottom: '1px solid gray', borderRadius: '0' }}
                                                            />
                                                            {!formValidPhone && <div className="text-danger">Phone number must be 10 digits</div>}
                                                        </div>

                                                        {/* Home Number */}
                                                        <div className="text-center">
                                                            <div className='text-left mt-3'>
                                                                <label htmlFor="homeNumber" className="form-label">Home Number</label>
                                                            </div>
                                                            <input
                                                                type='text'
                                                                id='homeNumber'
                                                                value={homeNumber}
                                                                placeholder='Enter your Home number'
                                                                className={`form-control ${(!homeNumber && !formValid) && 'border-bottom border-danger'}`}
                                                                onChange={handleHomeNumberChange}
                                                                style={{ border: 'none', borderBottom: '1px solid gray', borderRadius: '0' }}
                                                            />
                                                        </div>

                                                        {/* Email Address */}
                                                        <div className="text-center">
                                                            <div className='text-left mt-3'>
                                                                <label htmlFor="email" className="form-label">Email Address<span className='text-danger'>*</span></label>
                                                            </div>
                                                            <input
                                                                type='email'
                                                                id='email'
                                                                value={email}
                                                                placeholder='Enter your email'
                                                                className={`form-control mb-2 ${(!email && !formValid) && 'border-bottom border-danger'}`}
                                                                onChange={handleEmailChange}
                                                                style={{ border: 'none', borderBottom: '1px solid gray', borderRadius: '0' }}
                                                            />
                                                            {!formValidEmail && <div className="text-danger">Please enter a valid email address</div>}
                                                        </div>

                                                        {/* Age */}
                                                        <div className="text-center">
                                                            <div className='text-left mt-3'>
                                                                <label htmlFor="age" className="form-label">Age<span className='text-danger'>*</span></label>
                                                            </div>
                                                            <input
                                                                type='number'
                                                                id='age'
                                                                value={age}
                                                                placeholder='Enter your Age'
                                                                className={`form-control mb-2 ${(!age && !formValid) && 'border-bottom border-danger'}`}
                                                                onChange={(e) => setAge(e.target.value)}
                                                                style={{ border: 'none', borderBottom: '1px solid gray', borderRadius: '0' }}
                                                            />
                                                        </div>
                                                    </div>
                                                </div>

                                                {/* Course Details Section */}
                                                <div className="col-lg-6 mx-auto">
                                                    <div className="text-left">
                                                        <p className='PersonalPass' style={{ margin: '0' }}>Course Details<span className='text-danger'>*</span>
                                                                        <span className="text-primary " style={{ cursor: 'pointer' }} onClick={handleDownloadPDF}>   (Course Catolog)</span></p>
                                                        <hr className='Personal Personal--line' style={{ margin: '0' }} />

                                                        {/* Select Course */}
                                                        <div className="mt-3">
                                                            <div className='text-left'>
                                                                <label className="form-label">Select the course<span className='text-danger'>*</span></label>
                                                            </div>
                                                            {courseCatalog.map((course, index) => (
                                                                <div key={index} className="form-check text-left">
                                                                    <input
                                                                        type="checkbox"
                                                                        className="form-check-input"
                                                                        id={`course-${index}`}
                                                                        value={course}
                                                                        checked={selectedCourses.includes(course)}
                                                                        onChange={() => handleCourseSelection(course)}
                                                                    />
                                                                    <label className="form-check-label" htmlFor={`course-${index}`}>
                                                                        {course}
                                                                    </label>
                                                                </div>
                                                            ))}
                                                            {selectedCourses.length === 0 && (
                                                                <div className='text-danger'>*Please select at least one course</div>
                                                            )}
                                                        </div>

                                                        {/* Instructor Name */}
                                                        <div className="text-center mt-4">
                                                            <div className='text-left'>
                                                                <label htmlFor="instructorName" className="form-label">Enter your Name<span className='text-danger'>*</span></label>
                                                            </div>
                                                            <input type='text' id='instructorName' value={instructorName} placeholder='Enter your Name' className={`form-control ${(!instructorName && !formValid) && 'border-bottom border-danger'}`} onChange={(e) => setInstructorName(e.target.value)} style={{ border: 'none', borderBottom: '1px solid gray', borderRadius: '0' }}></input>
                                                        </div>

                                                        {/* Comments */}
                                                        <div className="text-center mt-3">
                                                            <div className='text-left'>
                                                                <label htmlFor="comments" className="form-label">Comments (contact the temple management for any further questions : (301) 414-0144 ) </label>
                                                            </div>
                                                            <textarea
                                                                id='comments'
                                                                value={comments}
                                                                placeholder='Enter your comments here'
                                                                className="form-control"
                                                                style={{ border: '1px solid gray', borderRadius: '5px', minHeight: '100px', padding: '5px' }} onChange={(e) => setComments(e.target.value)}
                                                            />
                                                        </div>
                                                    </div>
                                                </div>

                                                {/* Submit Button */}
                                                <div className='col-lg-12 mt-5'>
                                                    <div className="text-center">
                                                        <div className='text-left'>
                                                            <label htmlFor="state" className="form-label"></label>
                                                        </div>
                                                        <button id='submitBtn' onClick={handleSubmit} className="bg-blue-950 w-28 p-2 text-white rounded-md">Submit</button>
                                                    </div>
                                                </div>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            </div>

                        </div>
                    </div>
                </div>
            </div>
            <div>
                <Footer />
            </div>
            {showModal && (
                <div className="modal fade show " tabIndex="-1" role="dialog" style={{ display: 'block' }}>
                    <div className="modal-dialog modal-dialog-centered" role="document">
                        <div className="modal-content ">
                            <div className="modal-header">
                                <button type="button" className="btn-close bg-white" aria-label="Close" onClick={closeModal}></button>
                            </div>
                            <div className="modal-body">
                                <form >
                                    <div className="form-group">
                                        <label className="form-label passpri">Thank you for your submission! We have received your application and appreciate your interest in joining our Vedic School. Our temple management will review your submission and get back to you shortly with the next steps. If you have any urgent inquiries, feel free to reach out to us directly. We look forward to welcoming you to our vibrant community!</label>

                                    </div>

                                </form>
                            </div>

                        </div>
                    </div>
                </div>
            )}
        </>
    )
}

export default VedicSchool